import React from "react";
import "./Home.css"
import logo from "./images/logo.jpg"

const Home = () => {
    return(
        <div style={{marginTop: '5rem'}}>
            <div className="landing-logo">
                <img src={logo} alt=""/>
            </div>
        </div>
    )
}

export default Home
